import React from 'react';
import Slide1 from '../utils/Caurosel_img/slide-1.jpg';
import "../styles/Home.css";

function Home() {
  return (
    <div className="container mt-4">
  <div className="row">
    {Array.from({ length: 8 }).map((_, index) => (
      <div className="col-lg-3 col-md-4 col-sm-6 mb-4" key={index}>
        <div className="card fancy-card shadow-sm">
          <div className="card-body">
            <img src={Slide1} alt="Sengundhar Thirumana Mandapam" className="card-img-top mb-3 rounded" />
            <div className="d-flex align-items-center justify-content-between mb-3">
              <h2 className="card-title text-primary mb-0">Mandapam {index + 1}</h2>
              <i className="bi bi-geo-alt-fill text-danger fs-4"></i>
            </div>
            <p className="card-text text-muted">Located Opp to Murugan Kovil</p>
          </div>
          <button className="btn btn-success btn-lg w-100 fancy-btn">
            <i className="bi bi-eye-fill me-2"></i>View Details
          </button>
        </div>
      </div>
    ))}
  </div>
</div>

  )
}

export default Home
